using System;\nusing System.Diagnostics;\n\nclass Program\n{\n    static void Main()\n    {\n        ProcessStartInfo psi = new ProcessStartInfo\n        {\n            FileName = "aspnet_regsql.exe",\n            Arguments = "-S .\\SQLEXPRESS -E -A all -d YourDatabaseName",\n            RedirectStandardError = true,\n            UseShellExecute = false,\n            CreateNoWindow = true\n        };\n\n        try\n        {\n            using (Process process = Process.Start(psi))\n            {\n                string errors = process.StandardError.ReadToEnd();\n                process.WaitForExit();\n\n                if (process.ExitCode == 0 && string.IsNullOrEmpty(errors))\n                {\n                    Console.WriteLine("Database setup completed successfully.");\n                }\n                else\n                {\n                    Console.WriteLine($"An error occurred: {errors}");\n                }\n            }\n        }\n        catch (Exception ex)\n        {\n            Console.WriteLine($"Failed to execute aspnet_regsql.exe: {ex.Message}");\n        }\n    }\n}